window.bookSummaryJSON = "<p><b>Amidst the ruins of a broken empire, a new warlord rises to power. The worlds in his path call for help...and the United Planets Alliance answers. </b></p> <p>The Kenmiri Empire has fallen, broken against the might of the Vesheron rebels and the United Planets Space Force. The alliance between the Vesheron and the UPSF has collapsed in turn, leaving the former empire as worlds without governance or leaders. </p> <p>Amidst the chaos, the UPSF has launched a valiant effort to reach out to the weak and protect the defenseless. As part of the Peacekeeper Initiative, Colonel Henry Wong leads the battlecruiser <i>Raven </i>deep into once-hostile territory. </p> <p>There, an old ally has begun to forge a new empire from the old slave worlds. As starvation forces worlds to surrender, Henry prepares a desperate plan to bring food to the hungry - and defeat to those who conquer!</p>"; 
